  `voucher_entry`.`subjectId` AS `subjectId`,
  `voucher_entry`.`entryAbstract` AS `entryAbstract`,
  `voucher_entry`.`debit` AS `debit`,
  `voucher_entry`.`credit` AS `credit`,
